def calculate_earliest_delivery_time(A, B, C, D, E):
    times = [A, B, C, D, E]
    total_time = sum(((time + 9) // 10 * 10 for time in times))
    earliest_delivery_times = []
    for time in times:
        adjusted_time = (time + 9) // 10 / 10
        delay = adjusted_time - time
        earliest_delivery_times.append(total_time - delay)
    return min(earliest_delivery_times)

